  true,\n\t\"url\": null,\n\t\"notes\": \"Efficient and stable clock signal generation
  requirements at extrementemperatures and high radiation are not met with the current
  solutions.nChronos Technology proposes to evaluate RTXO as a new and comprehensivensolution
  that simultaneously addresses the requirements of a reliablenclock source in extreme
  environments. RTXO utilizes the larger band-gap,nsmaller intrinsic carrier concentration,
  high radiation tolerance andnextreme temperature capabilities of Silicon Carbide
  (Sic-4H)nsemiconductor technology. We will validate (thru FEA &amp;amp; othernanalysis)
  the trade-offs of advanced, high-Q Quartz and Galliumnorthophosphate resonator material
  (in thickness shear mode resonance),nconfiguration, processing, electronic interface
  and a matched mechanicalnsupport structure. Packaging technology approach addresses
  the uniquenneeds of integrating an environmentally sensitive high-Q resonatornoperating
  in the same environment as the rest of the components.nSuitable processes will be
  evaluated to yield reliable and repeatablenmanufacturing of RTXO as a viable and
  real life solution. All thendifferent elements and processes identified in this
  solution must complynand dovetail in order for a compact, robust, mono-metallicallyninterconnected
  and hermetically sealed housing configurationn(interconnection) to encapsulate the
  assembly. RTXO technical objectivenis to deliver exceptional performance over temperature
  ranges fromn-100?C and exceeding 400?C and radiation exceeding 300Krad (TID).\",\n\t\"license_title\":
